import React from "react";

import "./style.css";

function Navbar(props) {

  return (
    <nav className="navbar navbar-light bg-light height">
      <div className="row">
        <a className="navbar-brand text-cente col-lg-3 col-md-3 col-sm-3" href="/">
          <img src={props.image} width="100" height="100" alt="logo" />
        </a>
        <h1 className="title-font col-lg-6 col-md-6 col-sm-6 text-center navbar-text">
          {props.title}
        </h1>
        <div className="text-cente col-lg-3 col-md-3 col-sm-3">
          {props.login}
        </div>
      </div>

    </nav>
  );
}

export default Navbar;
